webpackJsonp([0xf8d05564b3c8],{5746:function(e,t){e.exports={data:{post:{html:"<p>Christopher's sick, Mama's out of town, and I should be at work already, but I'm not. I stayed home with Christopher yesterday. The thing is, he doesn't realize he's sick, so I had to keep reminding him that he has to keep his socks on, he can't go outside, and maybe he should take a nap (he didn't). Today he is sleeping in. He's well enough to go to the Tagesmutter, once he wakes up, but now it's already past 9, I wouldn't make it to the office until 10:30, and would have to leave right at 4.  My boss has offered to be flexible at such times, and today I think I'll take him up on it. At worst I'd take a vacation day from next year. So, gotta go, I hear stirring in Christopher's room....</p>",fields:{title:"Where Did The Time Go?",date:"24 Sep 2002",url:"https://papascott.de/2002-09-24-where-did-the-time-go/"}}},pathContext:{slug:"/2002-09-24-where-did-the-time-go/",prev:{fields:{title:"How Did We Get Into This Mess?",date:"24 Sep 2002",slug:"/2002-09-24-how-did-we-get-into-this-mess/"}},next:{fields:{title:"Joschi",date:"25 Sep 2002",slug:"/2002-09-25-joschi/"}}}}}});
